import React, { useState } from 'react';
import CssBaseline from '@mui/material/CssBaseline';
import Container from '@mui/material/Container';
import OptionTab from '../components/OptionTab'; // Import your OptionTab component here

const Undefined = () => {
  const [droppedItems, setDroppedItems] = useState([]); // State to store dropped items

  // Handle the drop action
  const handleDrop = (item) => {
    setDroppedItems([...droppedItems, item]);
  };

  return (
    <div style={{ display: 'flex' }}>
      <CssBaseline />
      <Container
        style={{
          minHeight: '100vh',
          border: '2px dashed #ccc',
          padding: '20px',
          position: 'relative',
        }}
      >
        {/* Your main content goes here */}
        <h1>Main Content</h1>

        {/* Render dropped items within the main content area */}
        {droppedItems.map((item, index) => (
          <div
            key={index}
            style={{
              border: '1px solid #ccc',
              padding: '10px',
              marginBottom: '10px',
            }}
          >
            {item}
          </div>
        ))}
      </Container>

      {/* Render the OptionTab component */}
      <OptionTab onDrop={handleDrop} />
    </div>
  );
};

export default Undefined;
